//get items from axios
import axios from "axios";
import { useEffect, useState } from "react";
type ItemType = {
    id: String;
    name: String;
    description: String;
    price: number;
    image: String;
};
const fetch = "http://localhost:8080/api/menu/getAllMenu";
export default function GetItems() {
    const [Items, SetItems] = useState<ItemType[]>([]);
    useEffect(() => {
        axios.get(fetch).then((res) => {
            SetItems(res.data);
        });
    }, []);
    return (
        <div>
            {Items.map((Item) => (
                <div key={Item.id}>
                    <img src={Item.image} alt="item" />
                    <h1>{Item.name}</h1>
                    <p>{Item.description}</p>
                    <p>{Item.price}</p>
                </div>
            ))}
        </div>
    );
}
